    [],nt"revision_timestamp": "2016-08-04T08:17:52.342296",nt"name": "arctic-national-wildlife-refuge-annual-narrative-report-calendar-year-1986",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Arctic
    NWR outlines Refuge accomplishments during the 1986 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, fire management, water rights, and wilderness areas.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, marine mammals, fisheries resources, scientific collections, and marking
    and bird banding. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, and computer systems. Cooperative
    programs, economic uses of the Refuge, and items of interest are provided at the
    end. Newspaper articles are attached.",nt"license_title": "License Not Specified",nt"extras":
